import React, { Component } from 'react'
import './ProjectLink.css'

export class ProjectLink extends Component {
    constructor(props){
        super(props)
    }


    render() {
        return (
            <div className="project-link-container">
                <img className="project-thumbnail" src={this.props.project.thumbnail}/>
                <h1 className="project-name">{this.props.project.name}</h1>
                {this.props.project.type==="website"?
                <div className="website-info-container">
                    <a className="website-live-link" href="">
                        Live Site
                    </a>
                    <a className="website-code-linke">
                        Code
                    </a>
                </div>:
                <div />}
            </div>

        )
    }
}

export default ProjectLink
